INSERT INTO `aboutuses` (`id`, `about_us`, `message_from_seo`, `created_at`, `updated_at`) VALUES
(1, '<p><strong>Scholarhaat</strong> stands at the forefront of educational innovation in Bangladesh, empowering students, educators, and guardians alike with a comprehensive, digital-first learning platform. Since our inception, <strong>Scholarhaat</strong> has set the bar for personalized education, offering seamless connections between students and the highest caliber tutors in the country. With a deep understanding of the evolving educational landscape, our founder has curated a platform that brings academic excellence and skill development directly to your fingertips.</p>\r\n\r\n<p>Launched in 2023, <strong>Scholarhaat</strong> is rapidly becoming the go-to destination for students seeking transformative educational experiences. Whether you&rsquo;re looking to elevate your academic performance, explore new skills, or prepare for competitive exams, <strong>Scholarhaat</strong> is committed to providing a personalized, tailored approach to learning that meets the individual needs of every student.</p>\r\n\r\n<p>We are more than just a tutoring platform&mdash;we are a community of passionate educators, innovative tools, and resources designed to foster success. By establishing exclusive partnerships with esteemed educational institutions and tutors from diverse backgrounds, we are able to offer an unrivaled selection of services that cater to all ages and educational levels.</p>\r\n\r\n<h3><strong>OUR VISION:</strong></h3>\r\n\r\n<p>To redefine the future of learning in Bangladesh, ensuring that every student has access to top-tier education, world-class tutors, and innovative learning tools&mdash;empowering them to reach their fullest potential, both academically and personally.</p>\r\n\r\n<h3><strong>OUR MISSION:</strong></h3>\r\n\r\n<p>To provide students with transformative, engaging learning experiences that foster intellectual growth, critical thinking, and lifelong learning. At <strong>Scholarhaat</strong>, we are committed to delivering personalized educational services that exceed expectations and inspire success.</p>\r\n\r\n<h3><strong>OUR SERVICES:</strong></h3>\r\n\r\n<p><strong>Scholarhaat</strong> offers a dynamic range of services, tailored to the diverse learning needs of our students. From K-12 tutoring to professional skill development, we connect students with top-rated tutors for both online and in-person sessions. Our services include:</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p><strong>Academic Tutoring</strong>: Focused support for primary, secondary, and higher education students in subjects ranging from mathematics to the humanities.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Skill Development</strong>: Personalized lessons in coding, digital marketing, languages, arts, and various vocational skills.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Exam Preparation</strong>: Specialized courses designed to prepare students for local and international exams, including SSC, HSC, IELTS, GRE, and SAT.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Corporate Training</strong>: We partner with businesses to provide customized learning solutions for employees, enhancing skills and fostering professional growth.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Online and Offline Learning</strong>: Offering flexibility, our students can choose between online tutoring or in-person lessons, ensuring convenience and access to high-quality education.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Tutoring for Adults and Lifelong Learners</strong>: Tailored tutoring services for adults seeking to upgrade their skills, pursue new hobbies, or complete professional certifications.</p>\r\n	</li>\r\n</ol>\r\n\r\n<h3><strong>OUR VALUES:</strong></h3>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>Innovation in Education</strong>: We leverage the latest technologies to enhance learning experiences and foster creativity in our students.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Personalized Learning</strong>: Every student is unique, and we design learning journeys that cater to their individual needs and goals.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Integrity and Transparency</strong>: We believe in clear, open communication with our students and guardians, providing a trustworthy and dependable service.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Commitment to Excellence</strong>: We continually improve our teaching methods, tools, and resources to ensure that our students receive the highest quality education.</p>\r\n	</li>\r\n</ul>\r\n\r\n<h3><strong>OUR EXPERT TEAM:</strong></h3>\r\n\r\n<p>At <strong>Scholarhaat</strong>, we believe that success begins with the right team. Our handpicked tutors are experts in their fields, boasting strong academic backgrounds, professional experience, and a passion for teaching. Each tutor is not just a teacher, but a mentor who is dedicated to guiding students through every step of their academic journey.</p>\r\n\r\n<p>We invest heavily in the professional development of our team, ensuring they stay up-to-date with the latest educational trends, tools, and technologies. This commitment to excellence has allowed us to build a network of tutors who are equipped to handle a diverse array of subjects and learning styles.</p>\r\n\r\n<h3><strong>OUR APPROACH:</strong></h3>\r\n\r\n<p>We take a holistic approach to education that focuses on both academic achievement and personal growth. Our platform facilitates active learning, where students engage with interactive materials, collaborate with tutors, and track their progress in real-time. By fostering a positive and encouraging environment, <strong>Scholarhaat</strong> ensures that every student thrives.</p>\r\n\r\n<h3><strong>OUR STRATEGIC FOCUS AREAS:</strong></h3>\r\n\r\n<p>To cement our position as the leading educational platform in Bangladesh, <strong>Scholarhaat</strong> is focused on four key strategic areas:</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p><strong>Financial Sustainability</strong>: Ensuring the platform remains financially strong, so we can continue to provide high-quality services at affordable rates.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Quality Assurance</strong>: Consistently delivering top-tier educational services that lead to satisfied, loyal customers who refer others.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Global Expansion</strong>: Expanding our network of tutors and services to serve the international market while maintaining the high standards that define <strong>Scholarhaat</strong>.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Technological Advancement</strong>: Continuously evolving our digital platform to provide a cutting-edge, user-friendly learning experience for both students and tutors.</p>\r\n	</li>\r\n</ol>\r\n\r\n<h3><strong>OUR SLOGAN:</strong></h3>\r\n\r\n<p><em>Learn, Achieve, Excel</em></p>\r\n\r\n<h3><strong>OUR LOCATIONS:</strong></h3>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>Head Office</strong>: House #10, Road #20, Mirpur, Dhaka - 1216, Bangladesh</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Online Learning</strong>: Available nationwide, with access to tutors from across the globe.</p>\r\n	</li>\r\n</ul>\r\n\r\n<h3><strong>CONTACT US:</strong></h3>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>Email</strong>:</p>\r\n\r\n	<p><strong>Scholarhaat</strong> stands at the forefront of educational innovation in Bangladesh, empowering students, educators, and guardians alike with a comprehensive, digital-first learning platform. Since our inception, <strong>Scholarhaat</strong> has set the bar for personalized education, offering seamless connections between students and the highest caliber tutors in the country. With a deep understanding of the evolving educational landscape, our founder has curated a platform that brings academic excellence and skill development directly to your fingertips.</p>\r\n\r\n	<p>Launched in 2023, <strong>Scholarhaat</strong> is rapidly becoming the go-to destination for students seeking transformative educational experiences. Whether you&rsquo;re looking to elevate your academic performance, explore new skills, or prepare for competitive exams, <strong>Scholarhaat</strong> is committed to providing a personalized, tailored approach to learning that meets the individual needs of every student.</p>\r\n\r\n	<p>We are more than just a tutoring platform&mdash;we are a community of passionate educators, innovative tools, and resources designed to foster success. By establishing exclusive partnerships with esteemed educational institutions and tutors from diverse backgrounds, we are able to offer an unrivaled selection of services that cater to all ages and educational levels.</p>\r\n\r\n	<h3><strong>OUR VISION:</strong></h3>\r\n\r\n	<p>To redefine the future of learning in Bangladesh, ensuring that every student has access to top-tier education, world-class tutors, and innovative learning tools&mdash;empowering them to reach their fullest potential, both academically and personally.</p>\r\n\r\n	<h3><strong>OUR MISSION:</strong></h3>\r\n\r\n	<p>To provide students with transformative, engaging learning experiences that foster intellectual growth, critical thinking, and lifelong learning. At <strong>Scholarhaat</strong>, we are committed to delivering personalized educational services that exceed expectations and inspire success.</p>\r\n\r\n	<h3><strong>OUR SERVICES:</strong></h3>\r\n\r\n	<p><strong>Scholarhaat</strong> offers a dynamic range of services, tailored to the diverse learning needs of our students. From K-12 tutoring to professional skill development, we connect students with top-rated tutors for both online and in-person sessions. Our services include:</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Academic Tutoring</strong>: Focused support for primary, secondary, and higher education students in subjects ranging from mathematics to the humanities.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Skill Development</strong>: Personalized lessons in coding, digital marketing, languages, arts, and various vocational skills.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Exam Preparation</str