(2, 'Shikho একাডেমিক প্রোগ্রাম SSC-HSC’র A+ প্রস্তুতি এখানেই', 'নবম থেকে দ্বাদশ শ্রেণি পর্যন্ত শিক্ষার্থীদের সারাবছর পড়ালেখার কমপ্লিট সল্যুশন', 'একাডেমিক প্রোগ্রাম', 'https://www.google.com', 'একাডেমিক প্রোগ্রাম', 'https://www.facebook.com', 'images/banner_image/1687410999_voqfh9ytswfrohzzjxje.webp', 1, '2023-06-21 23:16:39', '2023-06-21 23:22:18'),
(4, 'দেশব্যাপী সকল শাখায় সমান সেবা', 'দেশব্যাপী উদ্ভাস-উন্মেষ এর সকল শাখায় সমান সেবা প্রদান করা হয়। অভিন্ন প্রশ্নপত্রে সকল শাখায় পরীক্ষা নেওয়া হয়। সকল উত্তরপত্র মূল্যায়ন করা হয় এক জায়গা থেকে এবং একই Solve Sheet সকল শিক্ষার্থীকে প্রদান করা হয়।', 'একাডেমিক প্রোগ্রাম', NULL, 'একাডেমিক প্রোগ্রাম', NULL, 'images/banner_image/1687851480_deshbapy2.webp', 1, '2023-06-27 01:38:00', '2023-06-27 01:40:05');
INSERT INTO `blogs` (`id`, `category_id`, `title`, `slug`, `image`, `cover_image`, `blog_description`, `meta_title`, `meta_description`, `meta_keywords`, `status`, `created_at`, `updated_at`) VALUES
(2, 1, 'Guide to Planning Your International Trip during Eid', 'guide-to-planning-your-international-trip-during-eid', 'images/blog_image/1689061763_blog2.jpg', 'images/blog_image/1689062042_breadcrumb.jpg', '<h2>A Guide to Planning Your International Trip during Eid Vacation - Make Family Memories Abroad</h2>\r\n\r\n<p>It&#39;s time to start planning your Eid vacation abroad! Whether you&#39;re looking to explore a new country, experience different cultures, or just have fun in the sun - there is something special about taking an international family trip.</p>\r\n\r\n<p>You&#39;re lucky enough to have the perfect opportunity to make some unforgettable memories while&nbsp;<a href=\"https://obokash.netlify.app/holiday-packages-from-bangladesh\" target=\"_blank\">spending Eid abroad with Obokash Travels in your corner</a>, planning that once-in-a-lifetime trip has never been easier. We&#39;ll show you all the ins and outs of preparing for an international holiday with your family, from finding a package deal that accommodates everyone&#39;s needs and interests, to booking fun activities for the whole crew. So pack your bags and get ready for an incredible Eid break!</p>\r\n\r\n<h3>Planning Your International Trip from Bangladesh</h3>\r\n\r\n<p>Planning an international trip from Bangladesh can seem like a daunting task, but with a little bit of planning and some know-how, you can make sure everyone in your family has the time of their lives.</p>\r\n\r\n<p>First, you&#39;ll need to decide where to go. Consider factors such as nearby attractions, cultural experiences, and ease of travel when choosing a destination. Do some research online to find best places for family-friendly vacations, and be sure to ask your friends or family for any recommendations that come to mind.</p>\r\n\r\n<p>Second, book all of your transportation and accommodation in advance with the help of Obakash Travel&rsquo;s expert tour guides who are always available to assist you. They will ensure that your travel arrangements are properly organized, so you don&#39;t have any surprises when you get there. It&#39;s also important to factor in any visas or passports you need for the journey&mdash;this should be done at least eight weeks before your departure date. Finally, it&#39;s helpful to compile a list of activities that will interest both parents and children alike&mdash;make it fun by choosing something that nobody has tried before!</p>\r\n\r\n<h3>Building a Budget for Your International Trip from Bangladesh</h3>\r\n\r\n<p>Planning an international trip with your family can be daunting, especially if it&rsquo;s your first go-round. That&rsquo;s why budgeting is paramount. Building a budget will ensure you aren&rsquo;t left with unforeseen expenses and financial stress during what should be a time of joy and memories.</p>\r\n\r\n<p>When it comes to budgeting for a family-friendly international trip from Bangladesh, there are several important points to consider:</p>\r\n\r\n<ul>\r\n	<li><strong>Transportation</strong>: Research flight prices and compare the cost of train versus car&mdash;or even bus&mdash;depending on where you plan to travel. Don&rsquo;t forget that extra luggage costs money too!</li>\r\n	<li><strong>Accommodations</strong>: Look into hotels who offer special prices depending on the type of vacation you want to take.</li>\r\n	<li><strong>Food</strong>: Have an idea of where you might like to eat out or purchase food for meals in advance. Some cities have special Ramadan discounts so make sure to look into those as well!</li>\r\n	<li><strong>Activities</strong>: Research places your family might want to explore, such as landmarks or museums, so that you can get an idea of entrance fees and if there are any discounts available.</li>\r\n	<li><strong>Emergency Fund</strong>: Set aside some extra funds just in case something comes up while traveling, so that you&rsquo;re financially prepared for anything unexpected.</li>\r\n</ul>\r\n\r\n<h3><strong>Finding the Perfect Destination for a Family-Friendly Trip</strong></h3>\r\n\r\n<p>When it comes to planning a family-friendly international trip from Bangladesh during Eid, the first thing you&#39;ll need to do is find the perfect destination. There are plenty of amazing countries and cities with attractions that the whole family will enjoy.</p>\r\n\r\n<p><strong>Budget</strong></p>\r\n\r\n<p>The budget is always important when planning your trip. You should choose a location that fits within your budget while still offering plenty of activities and opportunities for sightseeing. Some destinations can be quite costly, so it&#39;s important to do your research and make sure that you don&#39;t overspend.</p>\r\n\r\n<p><strong>Travel Distance</strong></p>\r\n\r\n<p>Another thing to consider is the travel distance from Bangladesh. If you&rsquo;re looking for an international trip within a few hours of your home country, look no further than nearby India or Nepal. If you&rsquo;re willing to make a longer journey, Europe offers great cities like Amsterdam, Barcelona, Paris, Rome, and more!</p>', 'Guide to Planning Your International Trip during Eid', NULL, NULL, 1, '2023-07-11 07:49:23', '2023-07-11 07:54:02');
