INSERT INTO `pages` (`id`, `page_category_id`, `title`, `slug`, `page_description`, `status`, `created_at`, `updated_at`) VALUES
(1, 1, 'Disclaimer', 'disclaimer', '<p><strong>Disclaimer for Scholarhaat</strong></p>\r\n\r\n<p>Scholarhaat.com is a leading, innovative, and comprehensive educational platform dedicated to seamlessly connecting students and educators. Established by a team of highly skilled professionals, Scholarhaat is designed to redefine the learning experience by offering affordable, accessible, and user-centric solutions for both learners and instructors.</p>\r\n\r\n<p>At Scholarhaat, we offer a wide array of services, including personalized tutoring, specialized courses, a robust job board, and career-enhancing opportunities. Our mission is to create a holistic ecosystem where students can access the right educational resources, and educators can showcase their expertise and connect with the right audience. We are committed to ensuring that every interaction on our platform is enriching and contributes to long-term academic success.</p>\r\n\r\n<p>Launched with the vision to make education more efficient, personalized, and scalable, Scholarhaat has forged strategic partnerships with certified educators, recognized institutions, and industry professionals. This enables us to provide the highest quality of tutoring and educational content, addressing a diverse range of academic needs across various disciplines and skill levels.</p>\r\n\r\n<p>Scholarhaat is committed to leveraging cutting-edge technology to deliver a seamless, dynamic learning environment. We uphold the highest standards of security, ensuring that all personal data is protected in compliance with privacy regulations. While Scholarhaat strives to maintain quality and consistency in its services, we do not assume responsibility for the individual performance of tutors or third-party content accessed via the platform.</p>\r\n\r\n<p>By choosing Scholarhaat, you gain access to a trusted network of educational resources and a thriving community of learners and educators. We remain dedicated to empowering individuals, fostering growth, and elevating educational outcomes for all users.</p>\r\n\r\n<p><em>Join Scholarhaat today &ndash; your trusted partner in navigating the future of education.</em></p>', 1, '2023-07-11 08:53:54', '2025-05-14 16:10:08'),
(2, 1, 'Privacy policy', 'privacy-policy', '<p><strong>Privacy Policy for Scholarhaat</strong></p>\r\n\r\n<p>At Scholarhaat, we are committed to maintaining the privacy and protection of the personal data of our users. This Privacy Policy explains how we collect, use, disclose, and protect your personal information when you use our platform. Scholarhaat strives to provide a safe and secure environment for students, teachers, and educational institutions alike. By accessing or using Scholarhaat&rsquo;s services, you agree to the terms outlined in this policy.</p>\r\n\r\n<h3>1. Information We Collect</h3>\r\n\r\n<p>We collect several types of information to provide and improve our services:</p>\r\n\r\n<p>1.1 <strong>Personal Information</strong></p>\r\n\r\n<p>When you sign up or use our platform, we may collect personal details, including but not limited to:</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>Basic Personal Information</strong>: Name, email address, phone number, age, gender, and profile picture.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Educational Information</strong>: Your academic background, current educational level, subjects of interest, and preferred learning or teaching style.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Payment Information</strong>: If you use our platform for paid services (e.g., tutoring sessions), we collect financial details, including billing address, payment method, and transaction history.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Employment Information</strong>: For tutors and educators, we may collect your professional qualifications, experience, certifications, and references.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>1.2 <strong>Usage Data</strong></p>\r\n\r\n<p>We collect information about how you use Scholarhaat, including:</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>Session Data</strong>: IP address, browser type, device type, time zone, and operating system.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Navigation Data</strong>: Information about the pages you visit on the platform, features you interact with, and the time spent on each page.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Cookies and Tracking Technologies</strong>: Scholarhaat uses cookies, web beacons, and other tracking technologies to enhance user experience, analyze platform traffic, and personalize content. For more information, see our Cookie Policy.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>1.3 <strong>Communication Data</strong></p>\r\n\r\n<p>We may collect information when you contact us directly, such as:</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>Customer Support</strong>: Emails, phone calls, and live chat interactions.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>User Feedback</strong>: Any feedback, reviews, or suggestions provided by you regarding our services.</p>\r\n	</li>\r\n</ul>\r\n\r\n<h3>2. How We Use Your Information</h3>\r\n\r\n<p>Your personal data is used for the following purposes:</p>\r\n\r\n<p>2.1 <strong>Service Provision</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>To create and manage user accounts for both students and tutors.</p>\r\n	</li>\r\n	<li>\r\n	<p>To enable seamless communication between students and tutors.</p>\r\n	</li>\r\n	<li>\r\n	<p>To facilitate booking, scheduling, and payment for tutoring sessions.</p>\r\n	</li>\r\n	<li>\r\n	<p>To provide personalized educational recommendations and content.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>2.2 <strong>Platform Improvement</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>To analyze user behavior and interaction with the platform, helping us improve the functionality, usability, and user experience.</p>\r\n	</li>\r\n	<li>\r\n	<p>To implement new features, tools, and services based on user feedback and data.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>2.3 <strong>Marketing and Communication</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>To send promotional messages, newsletters, or educational updates based on your preferences.</p>\r\n	</li>\r\n	<li>\r\n	<p>To notify you about changes, updates, or issues related to your account or our services.</p>\r\n	</li>\r\n	<li>\r\n	<p>To offer personalized ads or content based on your interests.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>2.4 <strong>Legal Obligations</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>To comply with applicable laws, regulations, or legal processes (e.g., responding to legal requests or subpoenas).</p>\r\n	</li>\r\n	<li>\r\n	<p>To enforce our terms of service and investigate potential violations.</p>\r\n	</li>\r\n</ul>\r\n\r\n<h3>3. Data Security and Protection</h3>\r\n\r\n<p>At Scholarhaat, we implement industry-standard security practices to ensure the confidentiality, integrity, and availability of your personal data. We use encryption, firewalls, secure servers, and other tools to protect your information from unauthorized access, alteration, disclosure, or destruction. Despite these measures, no method of data transmission over the internet or electronic storage is completely secure. Therefore, we cannot guarantee absolute security, but we strive to protect your information to the best of our abilities.</p>\r\n\r\n<h3>4. Sharing Your Information</h3>\r\n\r\n<p>We do not sell, rent, or trade your personal data to third parties. However, we may share your data in the following situations:</p>\r\n\r\n<p>4.1 <strong>Service Providers</strong></p>\r\n\r\n<p>We may share your personal data with trusted third-party vendors who help us operate and manage Scholarhaat&rsquo;s services. These may include:</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Payment processors, hosting providers, and customer support systems.</p>\r\n	</li>\r\n	<li>\r\n	<p>Data analytics companies, email marketing providers, and advertising networks.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>These third-party providers are required to maintain the confidentiality and security of your data and are restricted from using it for purposes other than the services they provide.</p>\r\n\r\n<p>4.2 <strong>Tutors and Educational Institutions</strong></p>\r\n\r\n<p>For students, we may share your information with the tutors you have selected for personalized learning sessions. For tutors, we may share your information with students seeking tutoring services or institutions looking for educators.</p>\r\n\r\n<p>4.3 <strong>Legal Compliance</strong></p>\r\n\r\n<p>We may disclose your information if required by law or in response to valid requests by public authorities (e.g., a court order or government agency).</p>\r\n\r\n<p>4.4 <strong>Business Transfers</strong></p>\r\n\r\n<p>In the event of a merger, acquisition, or sale of assets, your personal data may be transferred to the acquiring party. We will notify you of any such change in ownership or control of your data.</p>\r\n\r\n<h3>5. Your Rights</h3>\r\n\r\n<p>As a user of Scholarhaat, you have certain rights over your personal data:</p>\r\n\r\n<p>5.1 <strong>Access and Update</strong></p>\r\n\r\n<p>You can access and update your personal information at any time by logging into your account settings. If you are unable to update any information, please contact us.</p>\r\n\r\n<p>5.2 <strong>Data Deletion</strong></p>\r\n\r\n<p>You may request that we delete your personal data by contacting our support team. Note that we may need to retain certain data for legal or business purposes.</p>\r\n\r\n<p>5.3 <strong>Opt-Out of Marketing</strong></p>\r\n\r\n<p>You may opt-out of receiving marketing communications by clicking the &ldquo;unsubscribe&rdquo; link in any promotional email or by adjusting your preferences in your account settings.</p>\r\n\r\n<p>5.4 <strong>Data Portability</strong></p>\r\n\r\n<p>You have the right to request a copy of your personal data in a structured, commonly used, and machine-readable format.</p>\r\n\r\n<p>5.5 <strong>Withdraw Consent</strong></p>\r\n\r\n<p>Where we rely on consent as the legal basis for processing your data, you may withdraw your consent at any time by contacting us.</p>\r\n\r\n<h3>6. Third-Party Websites</h3>\r\n\r\n<p>Scholarhaat may contain links to third-party websites or services. These third-party sites are not controlled by us, and we are not responsible for their privacy practices or content. We encourage you to read the privacy policies of any third-party sites you visit.</p>\r\n\r\n<h3>7. Children&rsquo;s Privacy</h3>\r\n\r\n<p>Scholarhaat is not intended for individuals under the age of 13. We do not knowingly collect personal data from children. If you are a parent or guardian and believe we have collected personal information from a child, please contact us immediately, and we will take steps to delete such data.</p>\r\n\r\n<h3>8. Changes to This Privacy Policy</h3>\r\n\r\n<p>We reserve the right to update this Privacy Policy at any time. Any changes will be posted on this page, and the &quot;Last Updated&quot; date at the bottom of this page will be revised accordingly. We encourage you to review this policy periodically for any updates.</p>\r\n\r\n<h3>9. Contact Us</h3>\r\n\r\n<p>If you have any questions or concerns about this Privacy Policy or our data practices, please contact us:</p>\r\n\r\n<p><strong>Email</strong>: <a href=\"mailto:support@scholarhaat.com\">support@scholarhaat.com</a><br />\r\n<strong>Phone</strong>: +880 1880-001126<br />\r\n<strong>Website</strong>: <a href=\"https://www.scholarhaat.com/\">www.scholarhaat.com</a></p>\r\n\r\n<p>&nbsp;</p>', 1, '2023-07-11 08:55:40', '2025-05-14 16:23:31'),
(3, 1, 'Terms & Conditions', 'terms-conditions', '<p>Terms &amp; Conditions We have given a 5% discount on all of our published packages, but no discount will be given to the EMI beneficiaries. All services depend on subject to availability at the time of booking. Any changes can occur without prior notice No refund in case of unused services or lesser duration of stay. Extra luggage other than mentioned on the ticket would be paid for by the pilgrim. The Tour operator is not responsible for the loss of luggage. com only provides consultancy service, doesn&rsquo;t provide any guarantee for visas. File processing for visas will start only after receiving all necessary documents. Processing time, requirements, and fees are subject to change by the Embassy without any prior notice. The embassy reserves all the rights to ask for any additional document other than the above-mentioned checklist. EMI Terms &amp; Condition For all Money Back transactions, Value Added Tax and SSL Wireless charge at the applicable rate shall be collected from the money-back value. The prevailing rate is 7%. What is a credit card chargeback? What is SSLCOMMERZ&#39;s credit card chargeback policy? A refund that is forced by a credit cardholder&#39;s credit card company is known as a chargeback. This occurs when a cardholder decides to formally dispute a charge on his/her credit card bill, usually because someone else fraudulently used that card number. Chargebacks are handled within the standard VISA/MC guidelines. However, we will pay the authorized amount to you once the confirmation is received from your site about the product purchase. In cases, when the cardholder requests a chargeback to his or her bank, the bank will not return and will direct the customers to you to gain his or her claimed money. What are SSLCOMMERZ&#39;s refund and end customer dispute policies? SSLCOMMERZ maintains a customer-friendly refund policy. This keeps our administrative costs under control in two ways: First, it reduces the amount of time spent researching customer inquiries; and secondly, it reduces the occurrence of charge-back disputes. (A chargeback dispute is a refund that is forced by the customer&#39;s credit card company.)</p>', 1, '2023-07-11 08:55:51', '2023-07-11 08:55:51'),
(4, 1, 'Return Refund Policy', 'return-refund-policy', '<h1><strong>Refund Policy for Scholarhaat</strong></h1>\r\n\r\n<p>At Scholarhaat, we are committed to providing the best educational experience for both students and educators. We strive to ensure that all our services are up to the highest standards. However, due to the nature of our services, we have outlined the following refund policy:</p>\r\n\r\n<h3>1. <strong>Non-Refundable Services</strong></h3>\r\n\r\n<p>All services provided on Scholarhaat, including but not limited to tutoring sessions, courses, and subscriptions, are <strong>non-refundable</strong>. Once a booking or payment is made, it cannot be refunded, exchanged, or transferred under any circumstances.</p>\r\n\r\n<h3>2. <strong>Cancellation Policy</strong></h3>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>Tutoring Sessions</strong>: If a session is canceled by the student or tutor less than 24 hours in advance, the session fee will be considered non-refundable.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Courses</strong>: Once a course has been booked or accessed, no refunds will be issued. We recommend that you review course details thoroughly before making a purchase.</p>\r\n	</li>\r\n</ul>\r\n\r\n<h3>3. <strong>Exceptional Circumstances</strong></h3>\r\n\r\n<p>In exceptional cases, such as technical errors or unavailability of services, we may offer a credit or alternative solution at our discretion. Refunds in such cases are considered on a case-by-case basis and are not guaranteed.</p>\r\n\r\n<h3>4. <strong>Account Termination</strong></h3>\r\n\r\n<p>In cases where a student or educator violates Scholarhaat&#39;s Terms of Service, the account may be terminated, and any payments made will not be refunded.</p>\r\n\r\n<h3>5. <strong>Changes to the Refund Policy</strong></h3>\r\n\r\n<p>Scholarhaat reserves the right to amend, update, or modify this refund policy at any time. We recommend you periodically review this policy for any changes.</p>\r\n\r\n<h3>6. <strong>Contact Us</strong></h3>\r\n\r\n<p>If you have any concerns or inquiries regarding our refund policy, please feel free to contact us at:</p>\r\n\r\n<p><strong>Email</strong>:&nbsp;<a href=\"mailto:_mainaccount@scholarhaat.com\">_mainaccount@scholarhaat.com</a><br />\r\n<strong>Phone</strong>: +880 1880-001126<br />\r\n<strong>Website</strong>: <a href=\"https://www.scholarhaat.com/\">www.scholarhaat.com</a></p>\r\n\r\n<hr />\r\n<p><strong>Last Updated:</strong>&nbsp;14 May,2025</p>\r\n\r\n<hr />\r\n<p>This policy aims to provide clarity and transparency regarding refunds, ensuring that both students and educators are aware of the terms and conditions governing their transactions on Scholarhaat.</p>', 1, '2023-07-11 08:56:02', '2025-05-14 17:22:59');
