INSERT INTO `tutor_feed_backs` (`id`, `name`, `designation`, `address`, `education`, `institute`, `image`, `description`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Alema Tayeba Hoq', '', '', '', 'Masturat Mohila Madrasah', 'images/tutor_feedback_image/1698469762_tutor.jpg', 'I really appreciate the initiative taken by Tuidion Dhaka. I\'m currently going with two tutors whom I found through Tuidion Dhaka. Both of them are caring & sincere. Besides, Birthday greetings from Tuidion Dhaka made us so happy. I wish their successful effort.', 1, '2023-10-28 05:09:22', '2023-10-28 05:09:22'),
(2, 'Joy Chandra Shaha', '', '', '', 'Dhaka University of Engineering and Technology (DUET)', 'images/tutor_feedback_image/1698469787_tutor1.jpg', 'I am a parent and I have found a tutor for my son by using the platform of Tuidion Dhaka. Received excellent support from them. My sincere thanks to their whole team.', 1, '2023-10-28 05:09:47', '2023-10-28 05:09:47'),
(3, 'Md. Abu Ibrahim Tamim', '', '', '', 'Jahangirnagar University', 'images/tutor_feedback_image/1698469812_turor3.jpg', 'Tuidion Dhaka is an excellent platform; Through which we can securely find an experienced tutor for our child according to his specific needs. As a parent, I am highly satisfied that I found a skilled tutor for my child at the right time. Alhamdulillah! Thanks to Tuidion Dhaka.', 1, '2023-10-28 05:10:12', '2023-10-28 05:10:12');
