(2, 2, 'Team Tutoring', 'Group tutoring allows students to learn together and solve problems at an affordable cost.', 'images/type_of_tution_image/1698473818_group.png', 1, '2023-10-28 06:16:58', '2025-05-11 22:01:49'),
(3, 3, 'Virtual Tutoring', 'Online TutoringFind the best tutors from anywhere and take online classes by using tools', 'images/type_of_tution_image/1698473832_online.png', 1, '2023-10-28 06:17:12', '2025-05-11 22:02:04'),
(4, 4, 'Tutoring Packages', 'Package tutoring helps a students to complete their studies within a specific time frame.', 'images/type_of_tution_image/1698473845_package.png', 1, '2023-10-28 06:17:26', '2025-05-11 22:02:29'),
